import Home from '../Home/Home';
import Portfolio from '../Portfolio/Portfolio';
import './App.css';
import text from '../../text.json';

function App() {
  return (
    <div className="App">
      <Home text={text[0].content}/>
      <Portfolio/>
    </div>
  );
}

export default App;
